import React, { useState } from "react";

const DiaryList = ({ diaryList }) => {
    const [filter, setFilter] = useState("all");
    return (
        <div>
            {diaryList.map((it) => {
                return <div key={it.id}>{it.content}</div>;
            })}
        </div>
    );
};

export default DiaryList;
